import React from 'react';
import Card from '../Components/Card'

const CardList = (data) => (
    <div className='supply__container'>
    {console.log(Object.values(Object.values(data)[0])[1])}
        {
            Object.values(data)[0].map((element) => {
                return(
                    <Card 
                        name={element.name}
                        cost={element.cost}
                        img={element.img}
                    />
                )
            })
        }
    </div>
)

export default CardList;
